import React from "react";

import CommonSection from "../components/UI/CommonSection";
import Helmet from "../components/Helmet.js/Helmet";
import { Container, Row, Col } from "reactstrap";

const Shop = () => {
  return (
    <Helmet title="Shop">
      <CommonSection title="Product" />
    </Helmet>
  );
};

export default Shop;
